import { Redirect } from "react-router-dom";

const Lastpage = () => {
    function homePage(e){
        e.preventDefault()
        return(<Redirect to='./'/>)
    }

    return (
        <div>
            <navbar>
                <button onClick={homePage}>Logout</button>
            </navbar>
            <h1>Psych You thought</h1>
        </div>
    )
}

export default Lastpage
